import Layout from "../components/layouts/layout";

const AboutPage = () => {
  const { SitemapStream, streamToPromise } = require("./index");
  const sitemap = new SitemapStream({ hostname: "https://www.corcoran.com" });
  sitemap.write({ url: "/page-1/", changefreq: "daily", priority: 0.3 });
  sitemap.write("/page-2");
  sitemap.end();

  streamToPromise(sitemap)
    .then((sm) => console.log(sm.toString()))
    .catch(console.error);

  <div>
    <h1>About page</h1>
    <Layout></Layout>
  </div>;
};

export default AboutPage;
